	add("deficiency", "{\"term\":\"deficiency\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|deficit|ency|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Inadequacy or incompleteness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d17|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dThe face which emerged was not reassuring.\u0026amp;nbsp;[…]. He was not a mongol but there was a \u0027\u0027deficiency\u0027\u0027 of a sort there, and it was not made more pretty by a latter-day hair cut which involved eccentrically long elf-locks and oiled black curls\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An insufficiency, especially of something essential to health\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/science-and-technology/21584316-women-may-fail-win-chairs-because-they-do-not-cite-themselves-enough-promotion Promotion and passage\u003dOne of academia’s \u0027\u0027deficiencies\u0027\u0027 is that, though its lecture halls and graduate schools are replete with women, its higher echelons are not. Often, this is seen as a phenomenon specific to the sciences.\u0026amp;nbsp;\u0026amp;hellip; In fact, the disparity applies to the whole grove. Another report from 2006, by the American Association of University Professors, found the same ratio in the faculties of arts, humanities and social science, too\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The amount by which the number of double points on a curve is short of the maximum for curves of the same degree\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The codimension of a linear system in the corresponding complete linear system\", \"priority\":6}]}, \"synonyms\":{}}");

	add("deficit", "{\"term\":\"deficit\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027déficit\u0027 from Latin {{m|la|dēficit}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Deficiency in amount or quality; a falling short; lack\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A situation wherein, or amount whereby, spending exceeds government revenue\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027 September 28, w:Kenan Kenan Malik, \u0026quot;[http://www.nytimes.com/2013/09/29/opinion/sunday/london-is-special-but-not-that-special.html?ref\u003dopinion London Is Special, but Not That Special],\u0026quot; \u0027New York Times\u0027 \u0026lt;small\u0026gt;(retrieved 28 September 2013)\u0026lt;/small\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Economically, too, London is startlingly different. The capital, unlike the country as a whole, has no budget \u0027\u0027deficit\u0027\u0027: London’s public spending matches the taxes paid in the city. The average Londoner contributes 70 percent more to Britain’s national income than people in the rest of the country\", \"priority\":4}]}, \"synonyms\":{}}");

