	add("definition", "{\"term\":\"definition\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) {{m|enm|diffinicioun|sc\u003dLatn}}, from Middle french (ca. 1400-1600) {{m|frm|definition|sc\u003dLatn}}, from Latin {{m|la|sc\u003dLatn|dēfīnītiō}}, from {{m|la|sc\u003dLatn|dēfīniō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A statement of the meaning of a word or word group or a sign or symbol (dictionary definitions\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A statement expressing the essential nature of something; formulatio\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The action or process of defining\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The act of defining; determination of the limits\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A product of defining\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The action or power of describing, explaining, or making definite and clear\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Her comic genius is beyond \u0027\u0027definition\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Clarity of visual presentation, distinctness of outline or detail\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027definition\u0027\u0027 of a telescope\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Improve the \u0027\u0027definition\u0027\u0027 of an image\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Clarity, especially of musical sound in reproduction\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Sharp demarcation of outlines or limits\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A jacket with distinct waist \u0027\u0027definition\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The degree to which individual muscles are distinct on the body\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A statement which provides a previous declaration with a value or body of a subroutine (in the case of function\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A statement that establishes the referent of a term or notation\", \"priority\":16}]}, \"synonyms\":{}}");

