	add("deflagration", "{\"term\":\"deflagration\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of deflagrating; an intense fire; a conflagration or explosion. Specifically, combustion that spreads subsonically via thermal conduction\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1849\u0027\u0027 Heinrich Rose - A Practical Treatise of Chemical Analysi\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"If, for example, the mixture of oxygen and hydrogen was twenty volumes, and three volumes of oxygen remained after the \u0027\u0027deflagration\u0027\u0027, the mixture consisted of six volumes of hydrogen and six volumes of oxygen\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027 Michael R Bromwich - The FBI Laboratory: An Investigation into Laboratory Practices \u0026amp; Alleged Misconduc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Black powder . . . It produces a relatively fast burn or \u0027\u0027deflagration\u0027\u0027 rather than a detonation and is classified as \u0026quot;low explosive\u0026quot\", \"priority\":5}]}, \"synonyms\":{}}");

